import { Container, Nav, Navbar } from "react-bootstrap";

const Header = ()=>{
    return(
        <Navbar bg="light">
            <Container>
                <Nav>
                    <Nav.Link href="/">Listagem</Nav.Link>
                    <Nav.Link href="/add">Cadastro</Nav.Link>
                </Nav>
            </Container>
        </Navbar>
    )

}

export default Header;
